import { createGlobalStyle } from "styled-components";

const MovesStyle = createGlobalStyle`
    .moves-container {
        height: 40vw;
        width: 20vw;
        background-color: red;
        margin-left: 5vw;
    }
`

function Moves() {
    return (
        <>
            <MovesStyle />
            <div className='moves-container'>
                <ul>
                    <li>123</li>
                    <li>456</li>
                    <li>789</li>
                </ul>
            </div>
        </>
    );
}

export default Moves;
